@Override
public NumericTermAttributeImpl clone() {
  NumericTermAttributeImpl t = (NumericTermAttributeImpl)super.clone();
  // Do a deep clone
  t.bytes = new BytesRefBuilder();
  t.bytes.copyBytes(bytes.get());
  return t;
}

